import React from 'react';
import styled from 'styled-components';

//  Styled sections
const Container = styled.div`
    display: flex;
`;
const Left = styled.div `
    flex: 1;
`;
const Center = styled.div `
    flex: 1;
`;
const Right = styled.div `
    flex: 1;
`;
const Logo = styled.div`
`;
const Description = styled.div`
`

const Footer = () => {
  return (
    <Container>
        <Left>
            <Logo>Tenun.</Logo>
            <Description>Tenun is platform for local seller Kediri City who want to increase their business, especially from apparel Batik sector </Description>
        </Left>
        <Center></Center>
        <Right></Right>
    </Container>
  )
}

export default Footer
